"""We faced a challenge in extracting information from the dataset due to the inconsistent structure of data in the .txt file, which contained nodes and edges along with their respective details.

In our network analysis nodes represent individual dolphins and edges indicate their interactions and relationships. However, we overcame this challenge by using regex expressions.
"""

# Read the dataset from the file
with open("/content/Dolphins.txt", "r") as file:
    data = file.read()

# Define regular expressions for nodes and edges
node_pattern = re.compile(r'\s*node\s*\[\s*(.*?)\s*\]', re.DOTALL)
edge_pattern = re.compile(r'\s*edge\s*\[\s*(.*?)\s*\]', re.DOTALL)

# Extract nodes and edges using regular expressions
nodes = node_pattern.findall(data)
edges = edge_pattern.findall(data)

# Process nodes
node_data = []
for node in nodes:
    node_id_match = re.search(r'\s*id\s+(\d+)\s*', node)
    node_label_match = re.search(r'\s*label\s+"(.*?)"\s*', node)
    if node_id_match and node_label_match:
        node_id = int(node_id_match.group(1))
        node_label = node_label_match.group(1)
        node_data.append((node_id, node_label))

# Process edges
edge_data = []
for edge in edges:
    source_match = re.search(r'\s*source\s+(\d+)\s*', edge)
    target_match = re.search(r'\s*target\s+(\d+)\s*', edge)
    if source_match and target_match:
        source = int(source_match.group(1))
        target = int(target_match.group(1))
        edge_data.append((source, target))

# Create a new graph
graph = nx.Graph()

# Add nodes with attributes
for node_id, node_label in node_data:
    graph.add_node(node_id, label=node_label)

# Add edges
for source, target in edge_data:
    graph.add_edge(source, target)

