# Convert `networkx` graph into `hiveplotlib`-ready nodes and edges
nodes, edges = networkx_to_nodes_edges(G)

# Pull out degree information from nodes
degrees = dict(G.degree)

# Add degree information and location data to Node instances
for node in nodes:
    node.add_data(data=dict(degree=degrees[node.unique_id], loc=node.unique_id))

# Define the number of communities (axes)
num_communities = 5

# Define the community assignments based on loc values
new_community_assignments = {
    0: [1, 5, 6, 9, 13, 17, 22, 25, 26, 27, 31, 32, 41, 48, 54, 56, 57, 60],
    1: [12, 14, 16, 20, 33, 34, 37, 38, 40, 43, 44, 46, 49, 50, 52, 53, 58, 61],
    2: [4, 11, 15, 18, 21, 23, 24, 29, 35, 45, 51, 55],
    3: [0, 2, 7, 10, 19, 30, 42, 47],
    4: [3, 8, 28, 36, 39, 59]
}

# Create HivePlot instance
hp = hplt.HivePlot()

# Define and add Axis instances for both inter-community and intra-community relationships
all_axes = {}
for comm_id in range(num_communities):
    axis_name = f"Community [{comm_id}]"
    inter_axis = hplt.Axis(axis_id=axis_name + " I", start=1, end=10, angle=(360 / (2 * num_communities)) * (2 * comm_id))
    intra_axis = hplt.Axis(axis_id=axis_name + " II", start=1, end=10, angle=(360 / (2 * num_communities)) * ((2 * comm_id) + 1))

    inter_axis._set_node_placement_label("degree")
    intra_axis._set_node_placement_label("degree")

    hp.add_axes([inter_axis, intra_axis])
    all_axes[axis_name] = (inter_axis, intra_axis)

# Create a set to keep track of added nodes
added_nodes = set()

# Place nodes on relevant axes based on community assignments
for comm_id, node_ids in new_community_assignments.items():
    inter_axis_id = f"Community [{comm_id}] I"
    intra_axis_id = f"Community [{comm_id}] II"

    # Filter nodes that have not been added to the HivePlot
    comm_nodes = [node for node in nodes if node.unique_id in node_ids and node.unique_id not in added_nodes]

    if comm_nodes:
        hp.add_nodes(comm_nodes)  # Add filtered nodes in the community to HivePlot
        hp.place_nodes_on_axis(inter_axis_id, unique_ids=[node.unique_id for node in comm_nodes], sorting_feature_to_use="degree")
        hp.place_nodes_on_axis(intra_axis_id, unique_ids=[node.unique_id for node in comm_nodes], sorting_feature_to_use="degree")
        added_nodes.update(node.unique_id for node in comm_nodes)

# Get a list of unique pairs of axis IDs
axis_ids = list(hp.axes.keys())
axis_pairs = [(axis_ids[i], axis_ids[j]) for i in range(len(axis_ids)) for j in range(i + 1, len(axis_ids))]

# Set the color palette
palette = sns.color_palette("Blues")

# Connect edges between nodes on different axes with different styles and colors
for i, (axis_id1, axis_id2) in enumerate(axis_pairs):
    edge_style = "dashed" if "II" in axis_id1 else "solid"

    comm_id1 = int(axis_id1.split("[")[1].split("]")[0])
    comm_id2 = int(axis_id2.split("[")[1].split("]")[0])

    if comm_id1 == comm_id2:
        edge_color = "darkgrey"  # Intra-community edges are dark grey
    else:
        edge_color = palette[comm_id1 % len(palette)]

    hp.connect_axes(edges=edges, axis_id_1=axis_id1, axis_id_2=axis_id2, color=edge_color, ls=edge_style)

# Plot the HivePlot with axes, nodes, and edges
fig, ax = axes_viz(hp, figsize=(10, 10))
node_viz(hp, fig=fig, ax=ax, color="C1", s=50, alpha=0.8)
edge_viz(hp, fig=fig, ax=ax, color="black")
ax.set_title("HivePlot of Intercommunity and Intracommunity Relationships", y=1.2, fontsize=20)
plt.show()

