"""A random walk is a mathematical concept used in graph theory and probability theory to model a sequence of steps taken through a network. In the context of the dolphin social network, a random walk involves moving from one dolphin to another based on the connections (edges) between them. At each step, a walker (or "node") selects a neighboring dolphin to move to with equal probability, mimicking a random traversal of the network.

In the random walk visualization, a starting dolphin is chosen, and subsequent steps are taken by randomly selecting a connected dolphin as the next step. This process can continue for a predefined number of steps or until there are no more available neighbors. The visualization represents the random walk path by highlighting the selected dolphins in a distinct color (e.g., red) and showing the edges between them.

In the case of the dolphin social network, a random walk provides insight into how information or interactions might spread through the network as dolphins move from one individual to another. It's important to note that the concept of a random walk is probabilistic and can be repeated multiple times to observe different paths and patterns within the network.
"""

# Create a NetworkX graph
G = nx.Graph()

# Add nodes with labels
for node_id, node_label in node_data:
    G.add_node(node_id, label=node_label)

# Add edges
for source, target in edge_data:
    G.add_edge(source, target)


# Choose a starting node for the random walk
start_node = random.choice(list(G.nodes()))

# Perform a random walk
num_steps = 50  # Number of steps in the random walk
random_walk = [start_node]
for _ in range(num_steps):
    neighbors = list(G.neighbors(random_walk[-1]))
    if neighbors:
        next_node = random.choice(neighbors)
        random_walk.append(next_node)
    else:
        break  # If no neighbors, stop the walk

# Create a plot of the random walk
plt.figure(figsize=(12, 12))
pos = nx.spring_layout(G)  # You can use any layout algorithm
nx.draw(G, pos, node_color='black', with_labels=True, font_color='white', font_weight='bold')
nx.draw_networkx_nodes(G, pos, nodelist=random_walk, node_color='red', node_size=200)
nx.draw_networkx_edges(G, pos, edgelist=[(random_walk[i], random_walk[i+1]) for i in range(len(random_walk)-1)], edge_color='red', width=2)

plt.title("Random Walk in Dolphin Social Network")
plt.show()

"""Now, with the help of igraph, we decided to focus on groups of four dolphins, also known as "cliques." These cliques are like super tight squads within the larger dolphin community. These cliques are highlighted in yellow with red lines connecting them. We chose the four-node cliques because they give us a nice balance between group dynamics and visual clarity.

We initially calculated that there are 84 possible cliques in the whole network. But this plot is showing just a snapshot of some of those cliques. We've got 27 of these clique groups in the plot because it strikes a good balance between showing a variety of cliques and not overwhelming the plot with too many.
"""

# Create an igraph Graph
g = ig.Graph()

# Add vertices with names from node_data
for node_id, node_label in node_data:
    g.add_vertex(name=node_label)

# Add edges using source and target names from edge_data
for source, target in edge_data:
    source_name = node_data[source][1]
    target_name = node_data[target][1]
    g.add_edge(source_name, target_name)

# Calculate the layout using the Fruchterman-Reingold algorithm
layout = g.layout_fruchterman_reingold()

# Get a list of cliques of size 4
cliques = g.cliques(4, 4)

# Create subplots for cliques
num_rows = (len(cliques) + 3) // 4  # Calculate the number of rows needed
fig, axs = plt.subplots(num_rows, 4, figsize=(15, 4 * num_rows))
axs = axs.ravel()

# Iterate through the cliques and plot them
for i, clique in enumerate(cliques):
    # Color vertices yellow/red based on whether they are in this clique
    g.vs['color'] = 'yellow'
    g.vs[clique]['color'] = 'red'

    # Color edges black/red based on whether they are in this clique
    clique_edges = g.es.select(_within=clique)
    g.es['color'] = 'black'
    clique_edges['color'] = 'red'
    # Also increase the thickness of clique edges
    g.es['width'] = 0.3
    clique_edges['width'] = 1

    # Plot the clique
    ig.plot(
        ig.VertexCover(g, [clique]),
        mark_groups=True,
        palette=ig.RainbowPalette(),
        target=axs[i],
    )

    # Set the title with clique number
    axs[i].set_title(f"Clique {i + 1}")

    # Display the list of dolphin names and IDs in the plot
    dolphin_list = ", ".join([f"{node_data[node][0]}: {node_data[node][1]}" for node in clique])
    axs[i].text(0.5, -0.1, dolphin_list, size=10, ha="center", transform=axs[i].transAxes)

    # Turn off the axis for cleaner visualization
    axs[i].axis('off')

# Hide remaining subplots that are not used
for j in range(len(cliques), num_rows * 4):
    axs[j].axis('off')

# Adjust layout and display the plots
plt.tight_layout()
plt.show()

